export default (state = [], action) => {
  console.log('test_redux-reducer_schedule', state, action)
	switch (action.type) {
		case 'INIT_SCHEDULE':
      return {'schedule': state, textError: '', loadingFlag: false};

		case 'LOAD_SCHEDULE':
			return {...state, loadingFlag: true};

		case 'LOAD_SCHEDULE_FAILURE':
			return null;

		case 'LOAD_SCHEDULE_SUCCESS':
			return action.payload;

		default:
			return {'schedule': state, textError: '', loadingFlag: false};
	}
};
